import React from 'react';
import { Button } from 'react-bootstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSun, faMoon, faBars, faCode } from '@fortawesome/free-solid-svg-icons';
import '../css/TaskBar.css';

const Taskbar = ({ toggleMode, modeNuit }) => {

  return (
    <div className="taskbar">
      <div className='menu_code'>
        <FontAwesomeIcon icon={faCode} size="1x" />
      </div>
      <Button className="mode_icon" onClick={toggleMode}>
        <FontAwesomeIcon icon={modeNuit ? faMoon : faSun} size="1x" />
      </Button>
      <div className='menu_bars'>
        <FontAwesomeIcon icon={faBars} size="1x" />
      </div>
    </div>
  );
};

export default Taskbar;
